function getDirectionsStyle(direction: string): string {
  let style;

  switch (direction) {
    case "up":
      style = "";
      break;
    case "right":
      style = "rotate-90";
      break;
    case "down":
      style = "rotate-180";
      break;
    case "left":
      style = "-rotate-90";
      break;
    default:
      style = "";
  }
  return style;
}

